import React from 'react'
import { inject, observer } from 'mobx-react';

@inject(example) @observer
export default class Counter extends React.Component {
    render() {
        return (
            <div>
                <h2>DENEME 2 BAKALIM </h2>
            </div>
        )
    }
}
